package ccxt

type Binanceus struct {
	*BinanceusCore
	Core          *BinanceusCore
	exchangeTyped *Binance
}

func NewBinanceus(userConfig map[string]interface{}) *Binanceus {
	p := NewBinanceusCore()
	p.Init(userConfig)
	return &Binanceus{
		BinanceusCore: p,
		Core:          p,
		exchangeTyped: NewBinanceFromCore(&(p.BinanceCore)),
	}
}
func NewBinanceusFromCore(core *BinanceCore) *Binance {
	return &Binance{
		BinanceCore:   core,
		Core:          core,
		exchangeTyped: NewExchangeTyped(&core.Exchange),
	}
}

